import React from 'react';
import './CaseStudies.css';

const CaseStudies = () => {
    return (
    <div className="row">
        <div className="column">
            <img src={process.env.PUBLIC_URL + '/dragon.jpeg'} alt="Case Study 1" style={{width:'100'}}/>
        </div>
        <div className="column">
            <img src={process.env.PUBLIC_URL + '/olympian.jpeg'} alt="Case Study 2" style={{width:'100'}}/>
        </div>
        <div className="column">
            <img src={process.env.PUBLIC_URL + '/skhokho.jpeg'} alt="Case Study 3" />
        </div>
    </div>
    );
}

export default CaseStudies;
